    let flipAudio = new Audio("https://assets.clumsylabs.io/land/audio/generic/clumsy-valley-click3.mp3");
    flipAudio.volume = 0.6;
    flipAudio.play();

    flipDefault.classList.toggle('activate');
    flipClick.classList.toggle('activate');

    setTimeout(() => {
      flipDefault.classList.remove('activate');
      flipClick.classList.remove('activate');
    }, 500);
  });
};

