if (arcadePurple) {
  arcadePurple.addEventListener('click', () => {
    let arcadePurpleAudio = new Audio("https://assets.clumsylabs.io/land/audio/generic/clumsy-valley-click3.mp3");
    arcadePurpleAudio.volume = 0.6;
    arcadePurpleAudio.play();

    // arcadePurple animation
    let arcadePurpleStatic = document.getElementById('screen-static-2_copy');
    let arcadePurpleStatic1 = document.getElementById('screen-static-1_copy');

    arcadePurpleStatic.classList.add('static');
    arcadePurpleStatic1.classList.add('static1');

    setTimeout(() => {
