// arcadePink animation
let arcadePink = document.getElementById('arcade-pink-animated');

if (arcadePink) {
  arcadePink.addEventListener('click', () => {
    let arcadePinkAudio = new Audio("https://assets.clumsylabs.io/land/audio/generic/clumsy-valley-click3.mp3");
    arcadePinkAudio.volume = 0.6;
    arcadePinkAudio.play();

    // arcadePink animation
    let arcadePinkStatic = document.getElementById('screen-static-2-3');
    let arcadePinkStatic1 = document.getElementById('screen-static-1-3');

    arcadePinkStatic.classList.add('static');
    arcadePinkStatic1.classList.add('static1');

    setTimeout(() => {
      arcadePinkStatic.classList.remove('static');
      arcadePinkStatic1.classList.remove('static1');
    }, 4000);
  });
};

let landBaseEL = false;
let cheatcodeEL = false;
let farmingFCIdEL = false;
let ghostEL = false;

if (landBase && landRoot) {

  var visible = false;
  var cheatCodesVisible = false;

  if (!landBaseEL) {
    landBaseEL = true;
    landBase.addEventListener('click', () => {
      let genericClickAudio = new Audio("https://assets.clumsylabs.io/land/audio/generic/clumsy-valley-click3.mp3");
      genericClickAudio.volume = 0.6;
      genericClickAudio.play();

      landRoot.classList.toggle('menu-in');

      var getName, getCoords, getFC;
      var farmingName, farmingCoords, farmingFC;
      farmingFC = document.getElementById('farming-fc');

      if (!visible) {
        fetch('https://internal.clumsylabs.io/api/v1/metadata/land/9618')
        .then(response => response.json())
        .then(json => {

          // Return values from internal clumsy api
          getName = json["name"]
          getCoords = json["coords"]
          getFC = json["fc"]
          getLink = json["link"]
          getTrack = json["track"]
          getTheme = json["theme"]
          getGhost = json["ghost"]

          if (getGhost) {
            var bigGhost = false;
            let ghost = document.getElementById('ghost');
            if (ghost) {
              ghost.setAttribute("href", getGhost);
              ghost.setAttribute("opacity", "1");

              if (!ghostEL) {
                ghostEL = true;
                ghost.addEventListener('click', () => {
                  let genericClickAudio = new Audio("https://assets.clumsylabs.io/land/audio/generic/clumsy-valley-click3.mp3");
                  genericClickAudio.volume = 0.6;
                  genericClickAudio.play();

                  if (!bigGhost) {
                    bigGhost = true;
                    ghost.setAttribute("href", getGhost);
                    ghost.setAttribute("opacity", "1");
                    ghost.setAttribute("height", "70");
                    ghost.setAttribute("width", "70");
                    ghost.setAttribute("x", "10");
                    ghost.setAttribute("y", "-8");
                  } else {
                    bigGhost = false;
                    ghost.setAttribute("height", "20");
                    ghost.setAttribute("width", "20");
                    ghost.setAttribute("x", "70");
                    ghost.setAttribute("y", "3");
                  }
              })}
            };
          }

          if (getName) {
            farmingName = document.getElementById('farming-name');
            farmingName.innerHTML = getName;
            console.log("Name: ", getName)
          }

          if (getCoords) {
            farmingCoords = document.getElementById('farming-coords');
            farmingCoords.innerHTML = getCoords;
            console.log("Coordinates: ", getCoords)
          }

          if (getFC) {
            farmingFC.innerHTML = "FC: " + getFC;
            console.log("Farming cycles completed: ", getFC)

            if (getFC >= 1 && getFC <= 9) {
              console.log("Tier 1 Land")
              farmingFC.classList.add('tier1');
            } else if (getFC >= 10 && getFC <= 29) {
              console.log("Tier 2 Land")
              farmingFC.classList.add('tier2');
            } else if (getFC >= 30 && getFC <= 49) {
              console.log("Tier 3 Land")
              farmingFC.classList.add('tier3');
            } else if (getFC >= 50 && getFC <= 99) {
              console.log("Tier 4 Land")
              farmingFC.classList.add('tier4');
            } else if (getFC >= 100) {
              console.log("Tier 5 Land")
              farmingFC.classList.add('tier5');
            } else {
              console.log("Tier 0 Land")
            }
          } else {
            getFc = 0;
          }

          if (getLink) {
            let valleyUrl = document.getElementById('valley-url');
            valleyUrl.setAttribute("href", getLink);
            console.log("Valley link: ", getLink)
          }

        })
        .catch(error => {
          getName = "";
          getCoords = "";
          getFC = 0;
          getLink = "";
          getTrack = "";
          getTheme = "";
          getGhost = "";
        });
      }

      if (!farmingFCIdEL) {
        farmingFCIdEL = true;
        farmingFCId.addEventListener('click', () => {
          cheatCodesVisible = true

          if (cheatCodesVisible) {
            let cheatCodeAudio = new Audio("https://assets.clumsylabs.io/land/audio/generic/cheatcodeactivated.mp3");
            cheatCodeAudio.volume = 1;
            cheatCodeAudio.play();

            farmingFC.innerHTML = "Cheat Codes Activated..."
            farmingFC.setAttribute("filter", "url(#stats-cheatcode)");
            let bufferArray = [];
            let lastKeystrokeTime = Date.now();
            const cheatcode = (e) => {

              const latestKeystrokeTime = Date.now();
              if (latestKeystrokeTime - lastKeystrokeTime > 5000) {
                if (getFC) {
                  farmingFC.innerHTML = "FC: " + getFC;
                } else {
                  farmingFC.innerHTML = "FC: ";
                }
                farmingFC.setAttribute("filter", "url(#stats-fc)");
                bufferArray = [];
              }

              if (e.key == "ArrowUp") {
                key = '↑';
              } else if (e.key == "ArrowDown") {
                key = '↓';
              } else if (e.key == "ArrowLeft") {
                key = '←';
              } else if (e.key == "ArrowRight") {
                key = '→';
              } else if (e.key.length == 1) {
                key = e.key;
              } else {
                key = ""
              }

              // each key press either adds or removes a char
              if (e.key == "Backspace") {
                bufferArray = bufferArray.slice(0, -1);
              } else if (bufferArray.length < 12 && key != "") {
                bufferArray.push(key);
              }

              farmingFC.innerHTML = bufferArray.join("")

              const word = bufferArray.join('');
              if (word === 'disco') { /* DISCO */
                cheatCodeAudio.play();
                console.log('Clumsy Valley Party!');

                landRoot.classList.add('party');
                clearListener();

                setTimeout(() => {
                  landRoot.classList.remove('party');
                }, 10000);
              } else if (word == '↑↑↓↓←→ab') { /* CODE */
                cheatCodeAudio.play();
                console.log('Nonstop Party!!!');

                landRoot.classList.add('party');
                clearListener();
              } else if (word === 'rgb') { /* RGB */
                cheatCodeAudio.play();

                landBase.classList.add('party');
                clearListener();

                setTimeout(() => {
                  landBase.classList.remove('party');
                }, 10000);
              } else if (word === 'gameover') { /* GAMEOVER */
                cheatCodeAudio.play();

                let gameoverId = document.getElementById('gameover-cheatcode');

                gameoverId.classList.remove('gameover-hide');
                gameoverId.classList.add('gameover-blink');

                let items = ["cd-cloud", "cd-top-terrain-1", "cd-top-terrain-2", "cd-top-terrain-3", "cd-top-terrain-4","cyber-district-base", 
                  "side-terrain-texture-1-animated", "side-terrain-texture-2", "side-terrain-texture-3-animated", "hover-car-animation", "clumsy-neon-sign-animated", 
                  "light-plant1_RGB", "light-plant2_RGB", "light-plant3_RGB", "light-plant4_RGB", 
                  "magnetic-plant-pink", "magnetic-plant-purple", "cyber-district-green-rocks4", "cyber-district-pink-rocks4", "trash", "holo-wen-animation", 
                  "spinning-star-animation", "cyber-monkii-animated", "powerline", "street-light-animated", "lava-lamp-animated", "balloon-dog", "sword-hologram-animated-loop", 
                  "ghostie-hologram-animated_loop", "cyber-district-green-rocks1", "cyber-district-pink-rocks1", "traffic-light-animated-loop", "neon-pink-palm-tree-animated-loop", 
                  "burger-sign-animated-loop", "arcade-red-animated", "arcade-orange-animated", "arcade-purple-animated", "arcade-pink-animated", "fire-barrel", 
                  "high-voltage-wire", "pizza-sign-animated-loop", "neon-green-palm-tree-animated-loop", "exclamation-mark--animated", "cyber-district-green-rocks5", 
                  "cyber-district-pink-rocks5", "vending-machine", "flip-animated", "security-bot-animated-loop", "roboto-animation", "vhs-tape", 
                  "controller", "console", "cd", "floppy-disk", "motorcycle", "box", "siren-animated-static", "cyber-district-green-rocks3", "cyber-district-pink-rocks3", 
                  "ambiance-animation"]

                for (let i = 0; i< items.length; i++) {
                  let item = document.getElementById(items[i]);
                  if (item) {
                    item.setAttribute("opacity", "0");
                  }
                }

                clearListener();

                setTimeout(() => {
                  gameoverId.classList.add('gameover-hide');
                  gameoverId.classList.remove('gameover-blink');

                  let items = ["cd-cloud", "cd-top-terrain-1", "cd-top-terrain-2", "cd-top-terrain-3", "cd-top-terrain-4","cyber-district-base", 
                    "side-terrain-texture-1-animated", "side-terrain-texture-2", "side-terrain-texture-3-animated", "hover-car-animation", "clumsy-neon-sign-animated", 
                    "light-plant1_RGB", "light-plant2_RGB", "light-plant3_RGB", "light-plant4_RGB", 
                    "magnetic-plant-pink", "magnetic-plant-purple", "cyber-district-green-rocks4", "cyber-district-pink-rocks4", "trash", "holo-wen-animation", 
                    "spinning-star-animation", "cyber-monkii-animated", "powerline", "street-light-animated", "lava-lamp-animated", "balloon-dog", "sword-hologram-animated-loop", 
                    "ghostie-hologram-animated_loop", "cyber-district-green-rocks1", "cyber-district-pink-rocks1", "traffic-light-animated-loop", "neon-pink-palm-tree-animated-loop", 
                    "burger-sign-animated-loop", "arcade-red-animated", "arcade-orange-animated", "arcade-purple-animated", "arcade-pink-animated", "fire-barrel", 
                    "high-voltage-wire", "pizza-sign-animated-loop", "neon-green-palm-tree-animated-loop", "exclamation-mark--animated", "cyber-district-green-rocks5", 
                    "cyber-district-pink-rocks5", "vending-machine", "flip-animated", "security-bot-animated-loop", "roboto-animation", "vhs-tape", 
                    "controller", "console", "cd", "floppy-disk", "motorcycle", "box", "siren-animated-static", "cyber-district-green-rocks3", "cyber-district-pink-rocks3", 
                    "ambiance-animation"]

                for (let i = 0; i< items.length; i++) {
                  let item = document.getElementById(items[i]);
                  if (item) {
                    item.setAttribute("opacity", "1");
                  }
                }

                }, 15000);
              } else if (word === 'hideme') { /* HIDEME */
                cheatCodeAudio.play();
                let items = ["hover-car-animation", "clumsy-neon-sign-animated", "light-plant1_RGB", "light-plant2_RGB", "light-plant3_RGB", "light-plant4_RGB", 
                "magnetic-plant-pink", "magnetic-plant-purple", "cyber-district-green-rocks4", "cyber-district-pink-rocks4", "trash", "holo-wen-animation", 
                "spinning-star-animation", "cyber-monkii-animated", "powerline", "street-light-animated", "lava-lamp-animated", "balloon-dog", "sword-hologram-animated-loop", 
                "ghostie-hologram-animated_loop", "cyber-district-green-rocks1", "cyber-district-pink-rocks1", "traffic-light-animated-loop", "neon-pink-palm-tree-animated-loop", 
                "burger-sign-animated-loop", "arcade-red-animated", "arcade-orange-animated", "arcade-purple-animated", "arcade-pink-animated", "fire-barrel", 
                "high-voltage-wire", "pizza-sign-animated-loop", "neon-green-palm-tree-animated-loop", "exclamation-mark--animated", "cyber-district-green-rocks5", 
                "cyber-district-pink-rocks5", "vending-machine", "flip-animated", "security-bot-animated-loop", "roboto-animation", "vhs-tape", 
                "controller", "console", "cd", "floppy-disk", "motorcycle", "box", "siren-animated-static", "cyber-district-green-rocks3", "cyber-district-pink-rocks3", 
                "ambiance-animation", "gameover-cheatcode"]

                for (let i = 0; i< items.length; i++) {
                  let item = document.getElementById(items[i]);
                  if (item) {
                    item.setAttribute("opacity", "0");
                  }
                }

                clearListener();

                setTimeout(() => {
                  for (let i = 0; i< items.length; i++) {
                    let item = document.getElementById(items[i]);
                    if (item) {
                      item.setAttribute("opacity", "1");
                    }
                  }
                }, 5000);
              } else if (word === 'usetheforce') { /* USETHEFORCE */
                cheatCodeAudio.play();
                let items = ["hover-car-animation", "clumsy-neon-sign-animated", "light-plant1_RGB", "light-plant2_RGB", "light-plant3_RGB", "light-plant4_RGB", 
                "magnetic-plant-pink", "magnetic-plant-purple", "cyber-district-green-rocks4", "cyber-district-pink-rocks4", "trash", "holo-wen-animation", 
                "spinning-star-animation", "cyber-monkii-animated", "powerline", "street-light-animated", "lava-lamp-animated", "balloon-dog", "sword-hologram-animated-loop", 
                "ghostie-hologram-animated_loop", "cyber-district-green-rocks1", "cyber-district-pink-rocks1", "traffic-light-animated-loop", "neon-pink-palm-tree-animated-loop", 
                "burger-sign-animated-loop", "arcade-red-animated", "arcade-orange-animated", "arcade-purple-animated", "arcade-pink-animated", "fire-barrel", 
                "high-voltage-wire", "pizza-sign-animated-loop", "neon-green-palm-tree-animated-loop", "exclamation-mark--animated", "cyber-district-green-rocks5", 
                "cyber-district-pink-rocks5", "vending-machine", "flip-animated", "security-bot-animated-loop", "roboto-animation", "vhs-tape", 
                "controller", "console", "cd", "floppy-disk", "motorcycle", "box", "siren-animated-static", "cyber-district-green-rocks3", "cyber-district-pink-rocks3", 
                "ambiance-animation", "gameover-cheatcode"]

                for (let i = 0; i< items.length; i++) {
                  let item = document.getElementById(items[i]);
                  if (item) {
                    let randomnum = Math.floor(Math.random() * (60 - 10) + 10) / 10;
                    item.style.animation = "cg-anim-antigrav 4s linear " + randomnum + "s infinite";
                  }
                }

                clearListener();

                setTimeout(() => {
                  for (let i = 0; i< items.length; i++) {
                    let item = document.getElementById(items[i]);
                    if (item) {
                      item.style.animation = "";
                    }
                  }
                }, 30000);
              } else if (word == 'valley') { /* VALLEY */
                cheatCodeAudio.play();
                if (audioValley) {
                  audioValley.currentTime = 0;
                  audioValley.play();
                } else if (getTrack) {
                  audioValley = new Audio(getTrack);
                  audioValley.volume = 0.4;
                  audioValley.play();
                }
                clearListener();
              } else if (word == 'theme') { /* THEME */
                cheatCodeAudio.play();
                if (audioTheme) {
                  audioTheme.currentTime = 0;
                  audioTheme.play();
                } else if (getTheme) {
                  audioTheme = new Audio(getTheme);
                  audioTheme.volume = 0.4;
                  audioTheme.play();
                }
                clearListener();
              } else {
                if (this.keyTimeout) {clearTimeout(this.keyTimeout)}
                this.keyTimeout = setTimeout(() => {
                  clearListener();
                }, 5000);
              }

              lastKeystrokeTime = latestKeystrokeTime;
              }

            if (!cheatcodeEL){
              cheatcodeEL = true;
              document.addEventListener('keyup', cheatcode, true);
            }

            const clearListener = () => {
              cheatCodesVisible = false;
              cheatcodeEL = false;
              if (getFC) {
                  farmingFC.innerHTML = "FC: " + getFC;
                } else {
                  farmingFC.innerHTML = "FC: ";
                }
              farmingFC.setAttribute("filter", "url(#stats-fc)");
              bufferArray = [];
              document.removeEventListener('keyup', cheatcode, true);
            }
          }
        });
      }

      visible = !visible
      farmingNameId.classList.toggle('show-farming-stats');
      farmingCoordsId.classList.toggle('show-farming-stats');
      farmingFCId.classList.toggle('show-farming-stats');
      });     
}}
